import {
  Card,
  CardContent,
  CardHeader,
  Divider,
  Grid,
  Typography,
} from "@material-ui/core";
import React from "react";
import { useParams } from "react-router-dom";
import useData from "../hooks/useData";

const Individual_Bank = () => {
  let { ifsc } = useParams();
  const { data } = useData();
  const rowdata = data.filter((item) => item.ifsc == ifsc)[0];
  return (
    <Card variant="outlined">
      <CardHeader> Bank Information</CardHeader>
      <Divider></Divider>
      <CardContent>
        <Grid item xs={6}>
          <Typography variant="h5" color="primary">
            Bank Name: {rowdata?.bank_name}
          </Typography>
        </Grid>
        <Grid item xs={6}>
          <Typography variant="h5" color="primary">
            Bank ID: {rowdata?.bank_id}
          </Typography>
        </Grid>
      </CardContent>
    </Card>
  );
};

export default Individual_Bank;
